import React,{useEffect, useState} from "react";
import axios from "axios";

const FacultyList = () => {
    const [faculties, setFaculties] = useState([]);

    useEffect(() => {
        const fetchFaculties = async () => {
            try {
                const response = await axios.get('http://localhost:5000/api/faculties');
                setFaculties(response.data);
            } catch (error) {
                console.error("Error fetching faculties:", error);
            }
        };

        fetchFaculties();
    }, []);
    return (
        <div>
            <h2>Faculty Members</h2>
            <ul>
                {faculties.map(faculty => (
                    <li key={faculty._id}>
                        <h3>{faculty.name}</h3>
                        <p>Department: {faculty.department}</p>
                        <p>Email: {faculty.email}</p>
                        <p>Phone: {faculty.phone}</p>
                        <p>Max Hours/Week: {faculty.maxHoursPerWeek}</p>
                        <p>Qualifications: {faculty.qualifications.map(sub => sub.name).join(', ')}</p>
                        <p>Unavailability: {faculty.unavailability.join(', ')}</p>
                    </li>
                ))}
            </ul>
        </div>
    );
}
export default FacultyList;
